import React, { useState } from 'react';
import { strategies } from '../lib/data';

const TABS = ['Trending', 'Rising Creators', 'By Meta', 'For You'];

export default function DiscoverTab({ goBack }) {
  const [active, setActive] = useState(0);
  const [selectedStrategy, setSelectedStrategy] = useState(null);

  const handleStrategyClick = (strategy) => {
    setSelectedStrategy(strategy);
  };

  const closeStrategyDetails = () => {
    setSelectedStrategy(null);
  };

  const getStrategiesForTab = () => {
    switch (active) {
      case 0:
        return strategies.trending;
      case 1:
        return strategies.rising;
      case 2:
        return strategies.meta;
      case 3:
        return strategies.forYou;
      default:
        return [];
    }
  };

  return (
    <div className="w-full max-w-6xl mx-auto py-12">
      {goBack && (
        <button onClick={goBack} className="mb-6 flex items-center text-sm text-blue-400 hover:underline focus:outline-none">
          <span className="mr-2">←</span> Back to Home
        </button>
      )}
      <h2 className="text-3xl font-bold text-gray-100 mb-8 text-center">Discover</h2>
      <div className="flex gap-4 justify-center mb-8">
        {TABS.map((tab, idx) => (
          <button
            key={tab}
            className={`px-4 py-1 rounded-full font-semibold text-base transition-all duration-200 ${active === idx ? 'bg-gradient-to-r from-zinc-800 to-zinc-700 text-white shadow' : 'bg-zinc-900/40 text-gray-400 hover:text-white hover:bg-zinc-800/60'}`}
            onClick={() => setActive(idx)}
          >
            {tab}
          </button>
        ))}
      </div>
      <div className="grid grid-cols-1 md:grid-cols-2 gap-8">
        {getStrategiesForTab().map((strategy) => (
          <div
            key={strategy.id}
            className="bg-black/30 backdrop-blur-lg rounded-2xl border border-zinc-500/40 shadow-xl p-8 flex flex-col gap-2 cursor-pointer hover:border-blue-500 transition-all"
            onClick={() => handleStrategyClick(strategy)}
          >
            <div className="flex items-center gap-2 mb-2">
              <span className="text-sm text-blue-400 font-bold">@{strategy.user}</span>
              <span className="bg-zinc-800 text-gray-300 rounded px-2 py-0.5 text-xs">Trending</span>
            </div>
            <h3 className="text-xl font-bold text-white">{strategy.title}</h3>
            <p className="text-gray-300 text-sm mb-2">{strategy.description}</p>
            <div className="flex items-center gap-2 text-xs text-green-400 mb-2">
              Win Rate: {strategy.metrics.find(m => m.label === 'Success Rate').value} 
              <span className="text-gray-400">•</span> 
              Live: {strategy.liveTokens} tokens
            </div>
            <button className="mt-auto px-4 py-2 rounded bg-zinc-800 border border-gray-600 text-sm text-white hover:bg-zinc-700 transition">
              View Flow
            </button>
          </div>
        ))}
      </div>

      {/* Strategy Details Modal */}
      {selectedStrategy && (
        <div className="fixed inset-0 bg-black/80 backdrop-blur-sm flex items-center justify-center p-4 z-50">
          <div className="bg-zinc-900 rounded-xl max-w-4xl w-full max-h-[90vh] overflow-y-auto">
            <div className="p-6">
              <div className="flex justify-between items-start mb-6">
                <div>
                  <h2 className="text-2xl font-bold text-white mb-2">{selectedStrategy.title}</h2>
                  <div className="flex items-center gap-2">
                    <span className="text-sm text-blue-400">@{selectedStrategy.user}</span>
                    <span className="bg-zinc-800 text-gray-300 rounded px-2 py-0.5 text-xs">Live: {selectedStrategy.liveTokens} tokens</span>
                  </div>
                </div>
                <button
                  onClick={closeStrategyDetails}
                  className="text-gray-400 hover:text-white"
                >
                  ✕
                </button>
              </div>

              <div className="grid grid-cols-1 md:grid-cols-2 gap-6 mb-6">
                <div className="bg-black/40 rounded-xl p-6 border border-zinc-800">
                  <h3 className="text-xl font-bold text-white mb-4">Strategy Parameters</h3>
                  <div className="space-y-3">
                    {selectedStrategy.parameters.map((param, index) => (
                      <div key={index} className="flex justify-between items-center">
                        <span className="text-gray-400">{param.label}</span>
                        <span className="text-white font-medium">{param.value}</span>
                      </div>
                    ))}
                  </div>
                </div>

                <div className="bg-black/40 rounded-xl p-6 border border-zinc-800">
                  <h3 className="text-xl font-bold text-white mb-4">Performance Metrics</h3>
                  <div className="space-y-3">
                    {selectedStrategy.metrics.map((metric, index) => (
                      <div key={index} className="flex justify-between items-center">
                        <span className="text-gray-400">{metric.label}</span>
                        <span className="text-green-400 font-medium">{metric.value}</span>
                      </div>
                    ))}
                  </div>
                </div>
              </div>

              <div className="bg-black/40 rounded-xl p-6 border border-zinc-800">
                <h3 className="text-xl font-bold text-white mb-4">Strategy Flow</h3>
                <div className="bg-zinc-900/50 rounded-lg p-4 border border-zinc-800">
                  <div className="text-gray-400 text-center">
                    Strategy flow visualization will be implemented here
                  </div>
                </div>
              </div>

              <div className="mt-6 flex justify-end">
                <button className="bg-gradient-to-r from-blue-500 to-purple-500 text-white px-6 py-2 rounded-lg hover:opacity-90 transition-all">
                  Apply to Workspace
                </button>
              </div>
            </div>
          </div>
        </div>
      )}
    </div>
  );
}
